import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
    return (
        <header>
            <h1>Starlight Tracker</h1>
            <nav>
                <Link to="/">Home</Link> | 
                <Link to="/star-info">Star Info</Link> | 
                <Link to="/constellation-info">Constellation Info</Link> | 
                <Link to="/feedback">Feedback</Link>
            </nav>
        </header>
    );
}

export default Header;
